INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('bg', 'bg', 'Здравейте, добре дошли в TalkieAI. Надявам се да имате приятно учебно изживяване.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('bn', 'bn', 'নমস্কার, TalkieAI ব্যবহারে স্বাগতম। আমি আশা করি আপনি একটি ভাল শিক্ষার অভিজ্ঞতা অর্জন করতে পারবেন।', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('ca', 'ca', 'Hola, benvingut a TalkieAI. Esperem que tinguis una bona experiència d\'aprenentatge.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('cs', 'cs', 'Dobrý den, vítejte v aplikaci TalkieAI. Doufáme, že budete mít dobrý zážitek při učení.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('da', 'da', 'Hej, velkommen til at bruge TalkieAI. Vi håber, at du får en god læringsoplevelse.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('de', 'de', 'Hallo, willkommen bei Talkie. Ich hoffe, Sie haben eine gute Lernerfahrung.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('el', 'el', 'Γεια σας, καλωσορίσατε στο TalkieAI, ελπίζουμε να έχετε μια καλή εμπειρία μάθησης.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('en', 'en', 'Hello, welcome to Talkie. We hope you have a good learning experience.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('es', 'es', 'Hola, bienvenido/a a TalkieAI. Espero que tengas una buena experiencia de aprendizaje.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('fi', 'fi', 'Hei, tervetuloa käyttämään talkiea, toivottavasti sinulla on hyvä oppimiskokemus.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('fr', 'fr', 'Bonjour, bienvenue sur TalkieAI. Nous espérons que vous passerez une bonne expérience d\'apprentissage.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('ga', 'ga', 'Dia duit, fáilte chuig talkie, tá súil agam go mbeidh taithí foghlama maith agaibh.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('he', 'he', 'שלום, ברוכים הבאים לשימוש ב-TalkieAI, מקווים שתהיה לך חווית למידה טובה.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('hi', 'hi', 'नमस्ते, टॉकी का स्वागत करते हैं। हमें आशा है कि आपको एक अच्छा सीखने का अनुभव मिलेगा।', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('hr', 'hr', 'Dobar dan, dobrodošli na TalkieAI. Nadamo se da ćete imati dobro iskustvo u učenju.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('hu', 'hu', 'Szia, üdvözöllek a TalkieAI-n. Reméljük, hogy jó tanulási élményben lesz részed.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('id', 'id', 'Halo, selamat datang di TalkieAI. Kami harap Anda memiliki pengalaman belajar yang baik.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('it', 'it', 'Ciao, benvenuto/a su TalkieAI. Spero che tu abbia una buona esperienza di apprendimento.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('ja', 'ja', 'こんにちは、TalkieAIをご利用いただきありがとうございます。良い学習体験をお楽しみください。', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('ko', 'ko', '안녕하세요, TalkieAI를 사용해 주셔서 감사합니다. 좋은 학습 경험을 가지시길 바랍니다.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('ms', 'ms', 'Halo, selamat datang ke TalkieAI. Kami harap anda akan mempunyai pengalaman pembelajaran yang baik.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('nb', 'nb', 'Hei, velkommen til TalkieAI. Vi håper du har en god læringsopplevelse.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('nl', 'nl', 'Hallo, welkom bij TalkieAI. We hopen dat je een goede leerervaring hebt.', null, null);
INSERT INTO settings_language_example (id, language, example, create_time, update_time) VALUES ('pl', 'pl', 'Cześć, witaj w TalkieAI. Mamy nadzieję, że będziesz miał/a dobrą przygodę z nauką.', null, null);
